import { Map } from "../Components/ComponentImports";
function Home() {
  return (
    <div className="container-fluid" id="grid-container">
      <div className="row show-grid h-75">
        <div className="col col-md-7" /*className="leaflet-container"*/>
          <Map />
        </div>
        <div className="col col-md-5"></div>
      </div>
      <div className="row">
        <div className="col-7"></div>
        <div className="col col-md-5"></div>
      </div>
    </div>
  );
}
export default Home;
